import React from "react";
import "./intro.css";
function Intro() {
  return (
    <div className="overlay">
      <div className="intro">
        <h1>HELLO,FRIEND!</h1>
        <p>enter your personal details and start journey with us </p>
        <button>signIn</button>
      </div>
    </div>
  );
}

export default Intro;
